import './styles.css';
import Navbar from './components/Navbar.js'
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Home from './routes/Home.js';

function App() {
  return (
    <div className='App'>
        <BrowserRouter>
          <Routes/>
        </BrowserRouter>

          <Navbar/>
          <Home/>

    </div>
  );
  }

export default App;
